import React, { useState } from "react";
import axios from "axios";

function App() {
  const [token, setToken] = useState(localStorage.getItem("token") || "");
  const [query, setQuery] = useState("");
  const [recommendations, setRecommendations] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  // ðŸ”‘ Example: login (replace with your real login flow)
  const handleLogin = async () => {
    try {
      const res = await axios.post("http://localhost:8000/api/auth/login", {
        email: "test@example.com",
        password: "password123",
      });
      setToken(res.data.access_token);
      localStorage.setItem("token", res.data.access_token);
      alert("âœ… Logged in successfully!");
    } catch (err) {
      console.error(err);
      alert("Login failed");
    }
  };

  // ðŸ’¡ AI Recommendation feature
  const handleSearch = async () => {
    if (!query.trim()) return;
    if (!token) {
      alert("Please login first");
      return;
    }

    setLoading(true);
    setError("");
    setRecommendations([]);

    try {
      const res = await axios.post(
        "http://localhost:8000/api/recommendations",
        { query },
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );

      let data = res.data.recommendations;

      // Try parsing JSON from AI output
      try {
        data = JSON.parse(data);
      } catch {
        // fallback if it's just text
        if (typeof data === "string") {
          const lines = data.split("\n").filter(Boolean);
          data = lines.map((line, i) => ({ title: line, id: i }));
        }
      }

      setRecommendations(data);
    } catch (err) {
      console.error(err);
      setError("Failed to fetch recommendations. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>ðŸ“š Book Tracker + AI Recommendations</h1>

      {!token ? (
        <button onClick={handleLogin} style={styles.loginButton}>
          Login (Demo)
        </button>
      ) : (
        <>
          <div style={styles.searchContainer}>
            <input
              type="text"
              placeholder="Ask AI... e.g. 'books like Harry Potter'"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              style={styles.input}
            />
            <button onClick={handleSearch} style={styles.button}>
              Search
            </button>
          </div>

          {loading && <p>Loading AI recommendations...</p>}
          {error && <p style={styles.error}>{error}</p>}

          <div style={styles.recommendations}>
            {recommendations.length > 0 && (
              <ul style={styles.ul}>
                {recommendations.map((book, index) => (
                  <li key={index} style={styles.card}>
                    <h3>{book.title || book.name}</h3>
                    <p>{book.author && <strong>Author:</strong>} {book.author}</p>
                    <p>{book.description || ""}</p>
                  </li>
                ))}
              </ul>
            )}
          </div>
        </>
      )}
    </div>
  );
}

// âœ¨ Simple inline styling (clean look)
const styles = {
  container: {
    maxWidth: "800px",
    margin: "40px auto",
    padding: "30px",
    borderRadius: "12px",
    background: "#f9f9f9",
    boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
    fontFamily: "sans-serif",
  },
  heading: {
    textAlign: "center",
    marginBottom: "20px",
  },
  loginButton: {
    display: "block",
    margin: "20px auto",
    backgroundColor: "#4CAF50",
    color: "white",
    padding: "10px 20px",
    border: "none",
    borderRadius: "8px",
    cursor: "pointer",
  },
  searchContainer: {
    display: "flex",
    gap: "10px",
    marginBottom: "20px",
  },
  input: {
    flex: 1,
    padding: "10px",
    border: "1px solid #ccc",
    borderRadius: "8px",
  },
  button: {
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    borderRadius: "8px",
    padding: "10px 16px",
    cursor: "pointer",
  },
  recommendations: {
    marginTop: "20px",
  },
  ul: {
    listStyle: "none",
    padding: 0,
  },
  card: {
    background: "white",
    padding: "15px",
    marginBottom: "10px",
    borderRadius: "8px",
    boxShadow: "0 2px 5px rgba(0,0,0,0.05)",
  },
  error: {
    color: "red",
    textAlign: "center",
  },
};

export default App;
